        DisplayForm display;
        Thread thread1, thread2;
        private bool _disposedValue;

        public I2CDisplay()
        {
            active = true;
            this.Log(LogLevel.Debug, "Display i2c connected");
            thread1 = new Thread(StartForm);
            thread1.Start();
            Reset();
        }

        ~I2CDisplay() => Dispose(false);

        // Public implementation of Dispose pattern callable by consumers.
        public void Dispose()
        {
            Dispose(true);
            GC.SuppressFinalize(this);
        }

        // Protected implementation of Dispose pattern.
        protected virtual void Dispose(bool disposing)
        {
            if (!_disposedValue)
            {
                if (disposing)
                {
                    display.Close();
                    thread2.Abort();
                    thread1.Abort();
                }

                _disposedValue = true;
            }
        }

        /**
        * Method used to invalidate the view of the form and redraw all the pixels (character)
        * This has been implemented as a while lopp in order to aviod that the display.Invalidate()
        * is called too frequently and make the form crash, refer to:
        * https://stackoverflow.com/questions/6157263/onpaint-not-getting-called-if-form-doesnt-have-focus
        */
        public void UpdateFrom(){
            while(true){
                if(display.needsToBeUpdate()){
                    display.Invalidate();
                    Thread.Sleep(30);
                }
            }
        }

        /**
        * Used to start the form show in a thread in order to not stop the main flow of the class
        */
        public void StartForm(){
            display = new DisplayForm(this);
            display.Text = "Display 2x" + DisplayForm.numberOfCharPerRow;
            thread2 = new Thread(UpdateFrom);
            thread2.Start();
            display.ShowDialog();
        }

        public void FinishTransmission() { }

        public byte[] Read(int count = 1)
        {
            return new byte[0];
        }

        public void Write(byte[] data)
        {
            byte[] b=data.ToArray();
            byte off=0x00;
            this.Log(LogLevel.Noisy, "Received {0} bytes: [{1}]", data.Length, string.Join(", ", data.Select(x => x.ToString())));
            if(data.Length == 4 && active){
                display.byteIn(data);
            }
            return;
        }

        public void Reset() {}

        /**
        * Method to enable or disable the display, active = False -> no actions performed
        */
        public bool Active
        {
            get
            {
                return active;
            }
            set
            {
                active = value;
            }
        }

        private bool active;

