            /**
            * Method used to load an image from the base64 string of it
            */
            public Image LoadBase64(string base64)
            {
                byte[] bytes = Convert.FromBase64String(base64);
                Image image;
                using (MemoryStream ms = new MemoryStream(bytes))
                {
                    image = Image.FromStream(ms);
                }
                return image;
            }

            protected override void OnPaint(PaintEventArgs e)
            {
                endUpdate = false;
                base.OnPaint(e);
                Pen selPen = new Pen(ColorTranslator.FromHtml("#6FA943"));
                SolidBrush blackPen = new SolidBrush(Color.Black);
                // Create matrix
                for(int a = 0; a < numberOfLines; a++)
                    for (int i = 0; i < numberOfCharPerRow; i++){
                        for(int ot = 0; ot < 5; ot++){
                            int charPos = (int)(charMatrix[a,i]);
                            byte fondLine = lcdFont[0];
                            if(charPos >=0 && charPos <= 7) {
                                // Fetch custom char
                                fondLine = customChar[charPos*5 + ot];

                            } else if (charPos - 32 >= 0 && charPos - 32 <= 93){
                                // Fetch normal ASCII char from lcdFond map
                                fondLine = lcdFont[(charPos - 32)*5 + ot];
                            }

                            int x = 91+i*35 + ot*6;
                            int y = 118 + a*56;
                            for(int p = 0; p < 8; p++){
                                if(((fondLine&0x80) >> 7).Equals(0x01))
                                    e.Graphics.FillRectangle(blackPen, new Rectangle(x, y + p*6, 6, 6));
                                e.Graphics.DrawRectangle(selPen, x , y + p*6, 6, 6);
                                fondLine = (byte)(fondLine << 1);
                            }
                        }
                    }
                    endUpdate = true;
                    needsUpdate = false;
            }

            // Atomic reference in order to say if the form should be updated
            Boolean needsUpdate = false;
            public Boolean needsToBeUpdate() {
                return needsUpdate && endUpdate;
            }

            DateTime startTime = DateTime.Now;
            public void updateView(){
                needsUpdate = true;
            }

            void clearDisplay(){
                 for(int a = 0; a < 2; a++)
                    for (int i = 0; i < numberOfCharPerRow; i++){
                        charMatrix[a,i] = 255;
                    }
            }

            void addChar(char c){
                if(i_d == EntryMode.ID_RIGHT){
                    if(colPos < numberOfCharPerRow){
                        charMatrix[rowPos,colPos++] = (byte)c;
                    }
                } else {
                    if(colPos < 0){
                        charMatrix[rowPos,colPos--] = (byte)c;
                    }
                }
            }

            public static string ToBin(int value, int len) {
            return (len > 1 ? ToBin(value >> 1, len - 1) : null) + "01"[value & 1];
            }
            // Refer to: http://web.alfredstate.edu/faculty/weimandn/lcd/lcd_initialization/lcd_initialization_index.html
            public void byteIn(byte[] data){
                // i2CDisplay.Log(LogLevel.Debug, "B " + ToBin((int)data[0], 8) + " " + ToBin((int)data[1], 8) + " " + ToBin((int)data[2], 8) + " " + ToBin((int)data[3], 8));
                byte command = (byte)((data[1]&0xf0) | ((data[3]&0xf0)>>4));
                bool isRs = (data[0]&0x01).Equals(0x01);
                if (currState == State.NO_INIT && (command&0x30).Equals(0x30))
                    currState = State.INIT1;
                else if (currState == State.INIT1 && (command&0x30).Equals(0x30))
                    currState = State.INIT2;
                else if (currState == State.INIT2 && (command&0x30).Equals(0x30))
                    currState = State.INIT3;
                else if (currState == State.INIT3 && (command&0x20).Equals(0x20)){
                    currState = State.BIT4;
                    i2CDisplay.Log(LogLevel.Noisy, "4 BIT interface started");
                } else if (currState == State.INIT3 && (command&0x30).Equals(0x30)){
                    currState = State.BIT8;
                    i2CDisplay.Log(LogLevel.Noisy, "8 BIT interface started - not supported");
                } else if(currState == State.BIT8) {
                    i2CDisplay.Log(LogLevel.Error, "8 BIT interface not supported");
                } else if(currState == State.BIT4) {
                    if(isRs){
                        // Write data to CGRAM or DDRAM
                        if(customCharState == State.NOREAD){
                            i2CDisplay.Log(LogLevel.Noisy, "Char received: " + ((char) command));
                            addChar((char) command);
                        } else {
                            // Custom char read
                            byte read = (byte)(data[1]&0xF0 | ((data[3]&0xF0) >> 4));
                            int offset = 7-(customCharState - State.READ0);
                            customChar[customCharWritePos*5] |= (byte)(((read&0x10) >> 4) << offset);
                            customChar[customCharWritePos*5 + 1] |= (byte)(((read&0x8) >> 3) << offset);
                            customChar[customCharWritePos*5 + 2] |= (byte)(((read&0x4) >> 2) << offset);
                            customChar[customCharWritePos*5 + 3] |= (byte)(((read&0x2) >> 1) << offset);
                            customChar[customCharWritePos*5 + 4] |= (byte)(((read&0x1) >> 0) << offset);
                            
                            if(customCharState == State.READ7){
                                customCharState = State.NOREAD;
                                for(int i = 0; i <  5; i++){
                                    i2CDisplay.Log(LogLevel.Noisy, "Custom read " + i + " " + customChar[customCharWritePos*5+i].ToString("X2"));
                                }
                                i2CDisplay.Log(LogLevel.Noisy, "Custom char read");
                            } else {
                                customCharState = (State)(customCharState + 1);
                            }
                        }
                    } else if((command&0xFF).Equals(0x01)){
                        // Display clear
                        clearDisplay();
                        i2CDisplay.Log(LogLevel.Noisy, "Display cleared");
                    } else if((command&0xFE).Equals(0x02)){
                        // Reset cursor position
                        rowPos = 0;
                        colPos = 0;
                        i2CDisplay.Log(LogLevel.Noisy, "Display position reset");
                    } else if((command&0xfC).Equals(0x04)) {
                        // Entry mode set
                        i_d = (command&0x2).Equals(0x2) ? EntryMode.ID_RIGHT : EntryMode.ID_LEFT; 
                        i2CDisplay.Log(LogLevel.Noisy, "I/D: " + i_d.ToString());
                    } else if((command&0xF8).Equals(0x08)) {
                        // Display ON OFF
                        isDiplayOn = (command&0x4).Equals(0x4) ? true : false;
                        i2CDisplay.Log(LogLevel.Noisy, "Display is now: " + isDiplayOn.ToString());
                    } else if((command&0xE0).Equals(0x20)) {
                        // Function Set
                        numberOfLines = (command&0x8).Equals(0x8) ? 2 : 1;
                        fontDim = (command&0x4).Equals(0x4) ? FontDimension.M_5_11 : FontDimension.M_5_8;
                        i2CDisplay.Log(LogLevel.Noisy, "Number of line: " + numberOfLines + " Font dimension: " + fontDim.ToString());
                    } else if((command&0xC0).Equals(0x40)){
                        // Set CGRAM address
                        customCharWritePos = ((data[1]&0x30) >> 3) | ((data[2]&0x80)>> 7);
                        i2CDisplay.Log(LogLevel.Noisy, "Custom char position: " + customCharWritePos);
                        customCharState = State.READ0;
                    } else if((data[1]&0x80).Equals(0x80)) {
                        // Set cursor position
                        colPos = Math.Min(numberOfCharPerRow, ((int)(data[2]&0xF0)>>4));
                        rowPos = ((data[1]&0x40)>>6).Equals(0x1) ? 1 : 0;
                        i2CDisplay.Log(LogLevel.Noisy, "Cursor set to: " + rowPos + " " + colPos);
                    } else {
                        i2CDisplay.Log(LogLevel.Error, "Unknown command");
                    }
                }
                updateView();
            }

